        self.fig.canvas.draw()

    def setup(self, t):
        if t == np.longdouble and MPL_VERSION < '2.1.0':
            raise NotImplementedError(
                'Long double not supported in this Matplotlib version')

        x = np.arange(10)
        x, y = np.meshgrid(x, x)
